import './index.css'
import Navbar from './NavBar'
import ShowItem from './Showitems'
import { useState } from "react";

const Home = () =>{
    const [deleteIcon, setDeleteIcon] = useState(false);
    return(
        <>
            <Navbar/> 
            <ShowItem deleteicon={deleteIcon} setDelete={setDeleteIcon}/>
            
        </>
    )
}


export default Home;
